import React from 'react';
import './Cube.css'; // Assuming you have a CSS file for Cube styling

const Cube = () => {
  return (
    <div className="cube">
      <div className="face front">Marketing</div>
      <div className="face back">Web Design</div>
      <div className="face right">Front-End</div>
      <div className="face left">UX/UI</div>
      <div className="face top">Welcome</div>
      <div className="face bottom">Benvenuto</div>
    </div>
  );
};

export default Cube;
